import React, { Component } from 'react'
import logo from '../components/ela-logo.png'
import logout from '../components/white-logout-logo.png'
import Styles from './employee.module.css'
import Cookies from 'universal-cookie';
class HeaderComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
                 
        }
    }

    handleLogout = () => {
        const cookies = new Cookies();
        cookies.remove("loginStatus");
        window.location.replace("/");
        alert("You have successfully logged out!")
    }

    render() {
        
        return (
            <header className={Styles.header}>
                <script>console.log("Header Rendered")</script>
                <img className={Styles.logoImage} src={logo} alt="Ela Logo" />
                <><img onClick={this.handleLogout} className={Styles.logoutButton} src={logout} alt="Logout Logo" /></>
          </header>
        )
    }
}

export default HeaderComponent
